package com.iyam.mycash.modelimport androidx.annotation.Keepimport com.google.gson.annotations.SerializedNameimport java.util.Date@Keepdata class User(    @SerializedName("id")    val id: String,    @SerializedName("name")    val name: String,    @SerializedName("email")    val email: String,    @SerializedName("phone_number")    val phoneNumber: String?,    @SerializedName("image")    val image: String?,    @SerializedName("is_verified")    val isVerified: Boolean,    @SerializedName("created_at")    val createdAt: Date,    @SerializedName("updated_at")    val updatedAt: Date)